import React, { useState, useRef, useEffect } from 'react';
import './App.css';

interface Translation {
  original: string;
  translated: string;
  language: string;
}

const App: React.FC = () => {
  const [isRecording, setIsRecording] = useState(false);
  const [translations, setTranslations] = useState<Translation[]>([]);
  const [targetLanguage, setTargetLanguage] = useState('es');
  const [error, setError] = useState<string | null>(null);
  const [isLoading, setIsLoading] = useState(false);

  const mediaRecorderRef = useRef<MediaRecorder | null>(null);
  const audioChunksRef = useRef<Blob[]>([]);
  const webSocketRef = useRef<WebSocket | null>(null);

  useEffect(() => {
    const protocol = window.location.protocol === 'https:' ? 'wss:' : 'ws:';
    const wsUrl = `${protocol}//${window.location.hostname}:3001`;

    try {
      webSocketRef.current = new WebSocket(wsUrl);

      webSocketRef.current.onopen = () => {
        console.log('Connected to WebSocket');
        setError(null);
      };

      webSocketRef.current.onerror = () => {
        setError('Failed to connect to server');
      };

      webSocketRef.current.onmessage = (event) => {
        try {
          const data = JSON.parse(event.data);
          if (data.translated) {
            setTranslations([data, ...translations]);
            setIsLoading(false);
          }
        } catch (e) {
          console.error('Error parsing message:', e);
        }
      };
    } catch (err) {
      console.error('WebSocket error:', err);
      setError('Could not connect to server');
    }
  }, []);

  const startRecording = async () => {
    try {
      setError(null);
      const stream = await navigator.mediaDevices.getUserMedia({ audio: true });
      const mediaRecorder = new MediaRecorder(stream);
      mediaRecorderRef.current = mediaRecorder;
      audioChunksRef.current = [];

      mediaRecorder.ondataavailable = (event) => {
        audioChunksRef.current.push(event.data);
      };

      mediaRecorder.onstop = () => {
        const audioBlob = new Blob(audioChunksRef.current, { type: 'audio/wav' });
        sendAudioToBackend(audioBlob);
      };

      mediaRecorder.start();
      setIsRecording(true);
    } catch (err) {
      setError('Microphone access denied');
    }
  };

  const stopRecording = () => {
    if (mediaRecorderRef.current && isRecording) {
      mediaRecorderRef.current.stop();
      mediaRecorderRef.current.stream.getTracks().forEach(track => track.stop());
      setIsRecording(false);
      setIsLoading(true);
    }
  };

  const sendAudioToBackend = (audioBlob: Blob) => {
    if (!webSocketRef.current || webSocketRef.current.readyState !== WebSocket.OPEN) {
      setError('Not connected to server');
      setIsLoading(false);
      return;
    }

    const reader = new FileReader();
    reader.onload = () => {
      const audioData = reader.result as string;
      webSocketRef.current!.send(JSON.stringify({
        type: 'audio',
        audio: audioData,
        targetLanguage,
      }));
    };
    reader.readAsDataURL(audioBlob);
  };

  return (
    <div className="App">
      <h1 className="Title">Voice Translation</h1>

      {error && <div style={{color: 'red', margin: '10px'}}>{error}</div>}

      <div style={{margin: '20px'}}>
        <label>Target Language: </label>
        <select value={targetLanguage} onChange={(e) => setTargetLanguage(e.target.value)}>
          <option value="es">Spanish</option>
          <option value="fr">French</option>
          <option value="de">German</option>
          <option value="zh">Chinese</option>
        </select>
      </div>

      <div>
        {!isRecording ? (
          <button className="Button" onClick={startRecording} disabled={isLoading}>
            Start Recording
          </button>
        ) : (
          <button className="Button" onClick={stopRecording}>
            Stop Recording
          </button>
        )}
      </div>

      {isLoading && <p>Processing...</p>}

      {translations.length > 0 && (
        <div className="Translations">
          <h2>Translations</h2>
          {translations.map((t, i) => (
            <div key={i} className="Translation">
              <p><strong>Original:</strong> {t.original}</p>
              <p><strong>Translated:</strong> {t.translated}</p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default App;
